import React from 'react';
import { motion } from 'framer-motion';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCheck } from '@fortawesome/free-solid-svg-icons';

const SubscriptionPlans = () => {
  const pricingPlans = [
    {
      id: 'monthly',
      title: 'Monthly Plan',
      price: 3000,
      pricePerDay: 100,
      description: 'Perfect for trial with one month commitment',
      popular: false,
      features: [
        'Homely meals delivered daily',
        'No additional delivery fee',
        'Free meal cancellation with 24h notice',
        'Change delivery location anytime'
      ]
    },
    {
      id: 'quarterly',
      title: 'Quarterly Plan',
      price: 8100,
      pricePerDay: 90,
      description: 'Our most popular balanced option',
      popular: true,
      features: [
        'Homely meals delivered daily',
        'No additional delivery fee',
        'Free meal cancellation with 24h notice',
        'Change delivery location anytime',
        'Priority delivery scheduling'
      ]
    },
    {
      id: 'halfyearly',
      title: 'Half-Yearly Plan',
      price: 14400,
      pricePerDay: 80,
      description: 'Best value for long-term subscribers',
      popular: false,
      features: [
        'Homely meals delivered daily',
        'No additional delivery fee',
        'Free meal cancellation with 24h notice',
        'Change delivery location anytime',
        'Priority delivery scheduling',
        'Premium menu options'
      ]
    }
  ];

  const scrollToSection = (sectionId) => {
    const section = document.getElementById(sectionId);
    if (section) {
      window.scrollTo({
        top: section.offsetTop - 80,
        behavior: 'smooth'
      });
    }
  };

  const formatPrice = (amount) => {
    return new Intl.NumberFormat('en-IN', {
      style: 'currency',
      currency: 'INR',
      maximumFractionDigits: 0
    }).format(amount);
  };

  return (
    <section id="subscription" className="py-16 md:py-24 bg-secondary">
      <div className="container mx-auto px-4 md:px-6">
        <motion.div
          className="text-center max-w-3xl mx-auto mb-16 section-fade"
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.6 }}
        >
          <h2 className="text-3xl md:text-4xl font-bold mb-4">Built for Your Budget</h2>
          <p className="text-xl text-gray-600">Transparent pricing with no hidden fees.</p>
        </motion.div>

        <div className="max-w-4xl mx-auto grid grid-cols-1 md:grid-cols-3 gap-8">
          {pricingPlans.map((plan, index) => (
            <motion.div
              key={plan.id}
              className={`bg-white rounded-2xl shadow-lg overflow-hidden relative transition-transform hover:scale-105 ${
                plan.popular ? "md:-mt-4 md:mb-4" : ""
              }`}
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
            >
              {plan.popular && (
                <div className="absolute top-0 right-0 bg-accent text-white text-xs font-semibold px-4 py-1 uppercase rounded-bl-lg">
                  Popular
                </div>
              )}
              <div className="p-8 text-center border-b border-gray-100">
                <h3 className="text-2xl font-semibold mb-2">{plan.title}</h3>
                <div className="text-primary text-4xl font-bold">
                  {formatPrice(plan.price)}
                </div>
                <div className="text-gray-400 text-lg font-normal">
                  ({formatPrice(plan.pricePerDay)}/day)
                </div>
                <p className="text-gray-600 mt-2">{plan.description}</p>
              </div>
              <div className="p-8">
                <ul className="space-y-4">
                  {plan.features.map((feature, idx) => (
                    <li key={idx} className="flex items-center">
                      <FontAwesomeIcon icon={faCheck} className="text-primary mr-3 h-4 w-4" />
                      <span>{feature}</span>
                    </li>
                  ))}
                </ul>
                <div className="mt-8 text-center">
                  <button
                    onClick={() => scrollToSection('daily-combos')}
                    className={`w-full btn ${
                      plan.popular 
                        ? "bg-accent hover:bg-orange-600 text-white" 
                        : "bg-primary hover:bg-primary/90 text-white"
                    }`}
                  >
                    Get Started
                  </button>
                </div>
              </div>
            </motion.div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default SubscriptionPlans;
